import React from "react"
import NewJob from "./NewJob"
import JobList from "./JobList"

function Jobs (job){
if(job.length){
   return job.map((job, index) => {
      return (
      <div>
      <li>
         <p>{job.neighborhood}</p>
         <p>{job.picture}</p>
         <p>{job.worker}</p>
         <p>{job.date}</p>
      </li></div>
         )
   })
      
   }
      
}
    export default Jobs
